import React from 'react';

function Card() {

  return (
    <div class="card">
      <img src="http://placekitten.com/g/600/300" alt="Avatar" style="width:100%"/>
      <div class="container">
        <h4><b>John Doe</b></h4> 
        <p>Architect & Engineer</p> 
      </div>
  </div>
  );
}
export default Card;
